import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Main from "./Main";
import { BrowserRouter } from 'react-router-dom';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Main />
      <App />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
